INSERT INTO `breakdowns` VALUES (1,1,'characters',NULL,NULL,'2021-03-29 20:17:02','2021-03-29 20:17:02'),(2,1,'settings',NULL,NULL,'2021-03-29 20:17:02','2021-03-29 20:17:02'),(3,1,'problem',NULL,NULL,'2021-03-29 20:17:02','2021-03-29 20:17:02'),(4,1,'solution',NULL,NULL,'2021-03-29 20:17:02','2021-03-29 20:17:02'),(5,1,'key-events',NULL,NULL,'2021-03-29 20:17:02','2021-03-29 20:17:02'),(6,2,'characters',NULL,NULL,'2021-05-14 05:47:15','2021-05-14 05:47:15'),(7,2,'settings',NULL,NULL,'2021-05-14 05:47:15','2021-05-14 05:47:15'),(8,2,'problem',NULL,NULL,'2021-05-14 05:47:15','2021-05-14 05:47:15'),(9,2,'solution',NULL,NULL,'2021-05-14 05:47:15','2021-05-14 05:47:15'),(10,2,'key-events',NULL,NULL,'2021-05-14 05:47:15','2021-05-14 05:47:15'),(11,2,'characters',NULL,NULL,'2021-05-14 07:09:23','2021-05-14 07:09:23'),(12,2,'settings',NULL,NULL,'2021-05-14 07:09:23','2021-05-14 07:09:23'),(13,2,'problem',NULL,NULL,'2021-05-14 07:09:23','2021-05-14 07:09:23'),(14,2,'solution',NULL,NULL,'2021-05-14 07:09:23','2021-05-14 07:09:23'),(15,2,'key-events',NULL,NULL,'2021-05-14 07:09:23','2021-05-14 07:09:23'),(16,3,'characters','[\"Witches has been brewing for the better part of 2 years now and in that time frame there seams to be a. \"]','{\"0\": \"Fae Black is Charlotte’s youngest daughter, a determined and strong willed twelve-year-old who’s secret obsession with magic becomes the catalyst for the return of her sisters and the turmoil they are ultimately thrown into. Her unique connection with the Spirit element ultimately leads to a break in the Inferno Prison, releasing Darkness into the world.\", \"1\": \"BROOKLYN BLACK is a down to earth seventeen-year-old, always trying to broker peace amongst her sisters. Upon discovering her grandmother’s music box, skilled in music and studying the science of sound, Brooklyn unlocks the key to the secret long held by her ancestors and eventually, to her gifted connection with the Air element.\", \"2\": \"MARGAUX BLACK, of all the daughters, had the closest relationship with her father and struggled profoundly after his death, closing herself off from her family and the world. Her toughest journey will be to overcome the blame she has placed in magic and the fear she has manifested surrounding her abilities. By unlocking them, she will discover a different kind of magic and an inescapable link to the Fire element.\", \"3\": \"COLBY BLACK is the wild child of the siblings, always up for bold new experiences and travels the world in pursuit of her passion for art; or perhaps just to find her true purpose? After all, her connection is to the Earth element. Colby’s determination to downplay her intelligence and thus avoid responsibility is soon undermined by her key role in the unveiling of the family secret and she must accept that she, too, is a valuable member of this journey.\", \"4\": \"VIOLETTE BLACK is the eldest sister of the Black family, growing up with a healthy respect for magic and an intrinsic sense of responsibility. Leaving the family to pursue her studies in medicine was a difficult decision, made even more so with her father’s passing. That decision fills her with guilt, which soon turns into an obsession with finding a way to cure their mother. It almost prevents her from discovering her connection to the Water element, but when she does, it is so strong she can create tidal waves.\", \"5\": \"CHARLOTTE BLACK’S health is slowly fading, the result of a failed spell intended to save the life of her husband. After his death, her four oldest daughters left the family home, unknowingly leaving their mother to endure this cancer-like illness. With their return and danger around every corner, Charlotte must find a way to harness her inner strength and guide her daughters to survive, revealing to them an inner strength they never knew she possessed. \", \"6\": \"ELEANOR BLACK is the very protective elder sister of Charlotte, aunt to Violette, Colby, Margaux, Brooklyn and Fae, and mother to two of her own daughters; Chantelle and Hannah. Still rebelling against her austere childhood, Eleanor lives an extravagant lifestyle, determined to be the antithesis of her own mother. Her long-held beliefs begin to change, however, as she endures a traumatic divorce and reconnects with the spirit of her deceased mother, realising that the darkness her mother predicted is stealthily infiltrating the world.\", \"7\": \"MARY BLACK - Mary Black is Charlotte and Eleanor’s mother and daughter to Eva Black. A women not openly admired by her daughters who unfortunately felt robbed of their childhood because of their mother\'s superstitions. Convinced of a darkness coming through a vision she received, Mary is the cause of many things that occur to the Black Daughters.  Her belief, something that shared no evidence or popular concern by other covens for a long time, labelled her a loose cannon amongst witches. For years, Mary collected things of the dark and even taught Eleanor and Charlotte how to use dark magic, because she believed that one day, when the darkness came, they would need it. Mary has died recently and many belongings have been given to Charlotte and Eleanor, instigating the family\'s journey to discover the secret. MANUELLE BLACK - Manuella, known as Manuelle, is a witch who experienced a difficult upbringing in hiding. Her mother Elizabeth, in desperation to save her, gave her to her Aboriginal servant, Alkina, to take away into the night before she was killed. Manuella, to remain safe and unconnected to Elizabeth who was burnt in their home, took on the persona of a boy and changed her name to Manuelle Black. Black for the colour of her blood.  She lived with Alkina’\'s family in the outback, a couple miles out of town until she was 12 years old and discovered she had a gift. Alkina gives Manuelle a music box that her mother had asked to be passed down to her when she was ready and tells her that her mother called it \\\"The key to their history.\\\"  Manuelle lives a troubled life when Alkina and her family are murdered and then her own. In her grief and to protect the secret, she sacrifices her life and spirit to the music box, where she remains until Fae crosses her over in the present. \", \"8\": \"EVA BLACK - Mary\'s mother Eva Black, had a dream that told her of a relative unborn coming to her from a future and that relative would need guidance towards a threat that has been slowly growing for thousands of years. That for the relative to come to her, she would need to create the pathway, the path through time. So when the time comes, she would find her and she could deliver the message.   Eva tells Colby that there is a darkness in their future. That this darkness has been breaking the walls that contain it for thousands of years and they are starting to crack. That Colby plays an important role and that she must help their people prepare for what’s coming. She tells Colby that the evidence is not strong enough for her to bring to the covens of her time, but in Colby’s  time, it must. \", \"9\": \"LOUISE BERKSHIRE - Louise was a young witch in a rich family, her father a mayor in England. Always mischievous, looking for the next exciting opportunity, no fear or common sense for safety. An exciting man shows interest towards Louise and convinces her to run away with him to be married. Madly in love with the man, Louise does so.  Upon leaving to another town, Louise is captured, to which she finds out is orchestrated by the man she fell in love with. Betrayed, pain and fear envelopes her. The Enlightened, who the man works for - uses a method to brainwash her. Using the anger to convince Louise that all witches must be destroyed. Once brainwashed, she is assigned to leave her life behind, to be sent to Australia to investigate a town Witch, known as Manuelle Black.  She is instructed to kill her family to emotionally disable her. Conflicted, Louise fakes their death not killing Manuelles family but ensuring Manuelle believes so. As MANUELLE performs the spell to sacrifice and protect the secret, she is unaware that Louise is in the house read to capture her and she too is trapped into the music bo\", \"12\": \"MANUELLE BLACK - Manuella, known as Manuelle, is a witch who experienced a difficult upbringing in hiding. Her mother Elizabeth, in desperation to save her, gave her to her Aboriginal servant, Alkina, to take away into the night before she was killed. Manuella, to remain safe and unconnected to Elizabeth who was burnt in their home, took on the persona of a boy and changed her name to Manuelle Black. Black for the colour of her blood.  She lived with Alkina’\'s family in the outback, a couple miles out of town until she was 12 years old and discovered she had a gift. Alkina gives Manuelle a music box that her mother had asked to be passed down to her when she was ready and tells her that her mother called it \\\"The key to their history.\\\"  Manuelle lives a troubled life when Alkina and her family are murdered and then her own. In her grief and to protect the secret, she sacrifices her life and spirit to the music box, where she remains until Fae crosses her over in the present. \", \"13\": \"LUCIO - Lucio works for the Enlightened and is assigned to observe the family. Lucio disguises himself as a Waiter that takes interest in Colby. However, unintentionally he falls in love with Colby and when the Enlightened kidnap Eleanor, is the reason that she isn\'t killed.\", \"14\": \"LUKE RICHTER - Luke, a popular kid studying music at the Sydney School of Music with Brooklyn, and is unaware that his father is part of the secret society hunting her family. When Brooklyn asks Luke for his help to track a man connected to hunting her family, she is unaware it is his father they are talking about. When Luke helps her break into the University  and sees his father, he confronts him. Luke’s father tries to convince him of their cause to protect the world form itself, but doesn