INSERT INTO `chapters` VALUES (1,1,2,'Tratata','<p>asdasdasdasdasdasdasd</p>','2021-03-29 20:17:55','2021-05-13 23:58:13'),(2,1,1,'Super','<p>Fae stares into the small flickering flame attached to the wick of the white candle. Its heat glowing with intensity as her eyes hold back from blinking. She\'s searching. Searching for answers that hold a tight fear in her heart to uncover.&nbsp;</p><p>Its golden warm colour contrasts against the dark dining room Fae sits in. A slight blue hue filters where the light of the full moon pierces through the open curtains.&nbsp;</p><p>Speckles of dust glitter as they float innocently in and out of the moonlight, landing on the long table for twelve empty chairs standing tall, lonesome.</p><p>The large home is quiet. Not even the winds pushing the dark trees outside can be heard from within the large home. Just the candles flame flicker, flick, flick. Fragile and unpredictable, like the spell she needs to perform.&nbsp;</p><p>Her hand twitches. She knows she has little time left of tonight\'s opportunity. If she misses it, she would have to wait too long again for the moon to eclipse and by then, the opportunity may be obsolete.&nbsp;</p><p>Blood coughed from the lungs never leaves one feeling time is on their side.</p><p>She reaches into her pocket and pulls out a tissue speckled with browning blood. Her heartbeat quickens. One of many she knows, hiding a truth she needs to know. She must know. Her mother was not something she could lose. Not when she is all she has left of her once happy, loud, chaotic witch family. No. If her mother won\'t tell her the truth, then she\'ll get it herself. And be damned how pissed she gets about it.&nbsp;</p><p>Fae holds the tissue up to the flame of the candle. \"Take this to which I cherish,\" she says as she lets go. The tissue does not fall down. It simply floats, its edges close the flames burn but narrowly missing. it almost looks beautiful, peaceful, dancing with the light below. Highlighting the contrast between tissue and her mother\'s blood.&nbsp;</p><p>The moon\'s light reaches the base of the candle. She takes a breath as she closes her eyes. She will find a way to help her, but first, she must find out what\'s wrong.&nbsp;</p><p>Her eyes open. \"What causes such blood to spill\", the tissue begins to spin above the flame, twisting, turning. What was beautiful before now feels violent.&nbsp;</p><p>It goes still. Then ever so slowly begins to fall. The flame touches the tissues edge and singer the white fibres. They continue to crawl, small sparks of light consuming until it reaches the blood. The specks burn a bright purple.</p><p>\"What ails its owners...\"</p><p>\"Fae?\" her mother\'s voice sounds from down the hall coming this way. No! \"Crap.\"</p><p>Fae quickly blows out the candle, the rooms goes dark and the tissue flutters to the table gently. Quickly she turns the lamp on by the reading chair, but accidently trips, knocking over a cardboard box labelled \'Mary Black\'. She doesn\'t see the small wooden box that rolled under the table as she sets the box back up, takes a seat back at the table, grabs the handle and trhows it in her school back at her feed. She raises her hand to the tissue still burning at it\'s sides, \"Evanescet Flamma.\" she whispers.&nbsp;</p><p>THe flames disappear and she quickly places her homework books over the tissue and ashes, just as her mother Charlotte walks in.&nbsp;</p><p>Charlotte, a beautiful woman in her mid 40\'s is dressed in her usual home attire. A knitted sweater and jean overalls covered in garden greens and dirt. It\'s not because shes a grub, but because she\'s always busy preping flowers and herbs for her little store in town. It always leaves her mother with a fresh, sweet, earthy smell.&nbsp;</p><p>Fae realises her mothers looking at her with concern. Right, she didn\'t answer. \"Are you ok?\" She asks while holding another cardboard box in her arms. This one also labelled, \'Mary black\'. Startled Fea nods, \"Just trying to work out an algebra equation.\"</p><p>Charlotte carries the box over to the others and put\'s it down. \"They do algebra in Grade 6? I suppose if 12 year olds today are capable of building companies, they can do algebra. Anyhow...\" She dusts off her pants looking at the row of boxes. \"This is the last of it. Considering how much crap she had. I suppose I should be grateful this is all we got.\"</p><p>Fae looked at the 7 boxes in a row. Her grandmothers name labelled on each. Then on the side, her mothers full name. \'Charlotte Black, 240 Rosemount Road, Longwood\'.&nbsp;</p><p>Fae didn\'t know her grandmother well. The last few years she had distanced herself from the family, or Fae supposed, her mother distanced them from her.&nbsp;</p><p>Now all that was left to know sat in those boxes.&nbsp;</p><p>Thunder crashed outside, followed by the tinerking of the rain on the roof. \"Hungry?\" her mother asked listening as well.</p><p>...</p><p>Sitting at the long dining table, Fae played with her dinner. Everynow and then glancing at her mother thatlso seamed to not touch her plate. She was too focussed on the numbers being written down in her notebook.&nbsp;</p><p>Fae knew it was work, but it bought a flash of pain ansshe remembered a time when the other seats at the able were filled. Her fathers voice saying to her sisters \"No work or tech at the table\". Everyone collectively knowing this was family time now.&nbsp;</p><p>That didn\'t exist anymore. It was just the two of them left and family felt a thing of the past. Fae glanced at the clock on the fireplace mantle. 7:45pm. It\'s started. She looked at her mother, completely oblivious. Completly...tired. Charlotte rubbed her eyes and sipped some water. Fae knew she had about an hour left. Time was running out.&nbsp;</p><p>She didn\'t like keeping secrets from her mother. They would do everything together. Usually. She could trust her with anything, everything. Maybe, she could have trusted her with this.&nbsp;</p><p>\"Mum.\" Fae struggled to find her voice. Charlotte didn\'t hear. \"Mum\" she said, a little more foracbly.&nbsp;</p><p>Charlotte looked up. \"Yes, darling?\"</p><p>\"It\'s an eclipse tonight.\" fae swallowed hard. Charlotte nodded and continued writing. \"I know.\"</p><p>This surprised Fae. From what she\'d seen, her mother had barely touched or thought about magic in almost 2 years. Let alone what the moon was doing. Maybe she\'d be willing to help. Maybe she might want to.&nbsp;</p><p>\"I thought maybe we could do something.\"</p><p>\"I can\'t Fea, you know I have a lot to do.\"</p><p>Fae feels a prickle of panic and then anger centered from her heart. \"But we can only do it tonight.\"</p><p>Charlotte stops writing. She looks at Fae with searching yet still eyes. \"Can only do what tonight?\"</p><p>Fae takes&nbsp;</p>','2021-05-13 23:58:06','2021-07-05 20:05:08'),(3,2,1,'Hello Life','<p>Presentations are communication tools that can be used as demonstrations, lectures, speeches, reports, and more. It is mostly prePresentations are communication tools that can be used as demonstrations, lectures, speeches, reports, and more. It is mostly prePresentations are communication tools that can be used as demonstrations, lectures, speeches, reports, and more. It is mostly presented before an audience. It serves a variety of purposes, making presentations powerful tools for convincing and teaching.</p><p></p><p>Presentations are communication tools that can be used as demonstrations, lectures, speeches, reports, and more. It is mostly prePresentations are communication tools that can be used as demonstrations, lectures, speeches, reports, and more. It is mostly prePresentations are communication tools that can be used as demonstrations, lectures, speeches, reports, and more. It is mostly presented before an audience. It serves a variety of purposes, making presentations powerful tools for convincing and teaching.</p><p>Presentations are 