sses it, she would have to wait too long again for the moon to eclipse and by then, the opportunity may be obsolete.&nbsp;</p><p>Blood coughed from the lungs never leaves one feeling time is on their side.</p><p></p><p>Fae stares into the small flickering flame attached to the wick of the white candle. Its heat glowing with intensity as her eyes hold back from blinking. She\'s searching. Searching for answers that hold a tight fear in her heart to uncover.&nbsp;</p><p>Its golden warm colour contrasts against the dark dining room Fae sits in. A slight blue hue filters where the light of the full moon pierces through the open curtains.&nbsp;</p><p>Speckles of dust glitter as they float innocently in and out of the moonlight, landing on the long table for twelve empty chairs standing tall, lonesome.</p><p>The large home is quiet. Not even the winds pushing the dark trees outside can be heard from within the large home. Just the candles flame flicker, flick, flick. Fragile and unpredictable, like the spell she needs to perform.&nbsp;</p><p>Her hand twitches. She knows she has little time left of tonight\'s opportunity. If she misses it, she would have to wait too long again for the moon to eclipse and by then, the opportunity may be obsolete.&nbsp;</p><p>Blood coughed from the lungs never leaves one feeling time is on their side.</p><p>She reaches into her pocket and pulls out a tissue speckled with browning blood.&nbsp;Her heartbeat quickens. One of many she knows, hiding a truth she needs to know. She must know. Her mother was not something she could lose. Not when she is all she has left of her once happy, loud, chaotic witch family. No. If her mother won\'t tell her the truth, then she\'ll get it herself. And be damned how pissed she gets about it.&nbsp;</p><p>Fae holds the tissue up to the flame of the candle. \"Take this to which I cherish,\" she says as she lets go. The tissue does not fall down. It simply floats, its edges close they go into the darkness of what has been the best time of their life and how they don\'t know what they are talking about and if it is infact best to do it that way. Some may find it confusing for other to understand but they are ok with that con</p>','2021-05-30 05:26:46','2021-07-28 23:03:26'),(6,7,1,'Test 1','<h3><strong>Классический текст Lorem Ipsum, используемый с XVI века</strong></h3><p>\"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\"</p><h3><strong>Абзац 1.10.32 \"de Finibus Bonorum et Malorum\", написанный Цицероном в 45 году н.э.</strong></h3><p>\"Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?\"</p><h3><strong>Английский перевод 1914 года, H. Rackham</strong></h3><p>\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you 