-06-22 22:34:34','2021-07-28 09:17:15'),(7,8,1,'hey','<p>When choosing a solar inverter for your system, are you unsure whether to go budget or premium?</p><p></p><p>If you ask us, when it comes to inverters, premium is your best choice.&nbsp;&nbsp;</p><p></p><p>Premium inverters have longer warranties and their also made of better quality components that make them less likely to fault.&nbsp;</p><p></p><p>Remember, the inverter is the heart of your system; it never stops working for you.&nbsp;</p><p></p><p>So you want a brand that has proven its reliability in performance and longevity. Otherwise, you\'re at risk for a broken-down budget inverter in 4 years, with a 3 month turnaround time on replacement. To which your system is out of action and not saving you money.</p><p></p><p>All our inverters are connected to the supplier portals, so we know before you do if there is an issue and can identify and resolve it immediately. We\'re also a SMA PowerUP partner and in the unlikely chance your inverter has a fault, we are licenced to assist you directly, instead of waiting for tech support.&nbsp;</p><p></p><p>Visit our website&nbsp;<a href=\"http://www.leesongroup.com.au\" rel=\"noopener noreferrer nofollow\">leesongroup.com.au</a>&nbsp;and apply for your free solar assessment for more information.</p>','2021-06-23 03:22:08','2021-06-23 03:22:11'),(8,11,1,'The long road','<p>Eliza looks out at the long road she knows is well travelled. Morning and night, it is filled with the busy life of society. And sometimes...</p><p>She feels the<em> slight</em>&nbsp;uncomfortable feeling that as she watches those passing, that time</p>','2021-07-13 09:29:09','2021-07-13 09:30:28'),(9,11,2,'The wonder of hilltop','<p>\"Oh here is what i\'ve been looking for\", Said Eliza.</p>','2021-07-13 09:30:42','2021-07-13 09:31:09'),(10,7,2,'Test2','<p>asdasdasd</p><p>1231231</p>','2021-08-01 02:24:29','2021-08-01 02:24:33');
