INSERT INTO `notes` VALUES (1,1,0,'asdasdasda','<p>123asdasdasdasdasd</p>','2021-03-29 20:17:41','2021-03-29 20:17:46'),(2,3,1,'Bobs Your Uncle',NULL,'2021-05-16 22:00:06','2021-05-16 22:00:06'),(3,1,1,'asdasda',NULL,'2021-05-18 09:41:14','2021-05-18 09:41:14'),(4,1,0,'a213123',NULL,'2021-05-18 09:41:17','2021-05-18 09:41:17'),(5,3,2,'Book Series Timeline (old)','<p><strong>EPISODE ONE “GHOSTS OF PAST”</strong></p><p><strong>Family separated, living normal lives.&nbsp;</strong></p><p><strong>Fae calls sisters for help - concern on Charlotte’s health.</strong></p><p><strong>Fae unleashes 2 spirits from Music Box.</strong></p><p><strong>Spirits attack Fae and Charlotte - Destroy Home.</strong></p><p><strong>Sisters come home - no one knows what happened.</strong></p><p><strong>Sisters decide to reuse magic - except Margaux (Very Angry about decision)</strong></p><p><strong>Manuelle Spirit Possess Fae - informs of two spirits to family.</strong></p><p><strong>Concerns of Europe have escalated.</strong></p><p><strong>Coven is informed of Spirits. “Her” is looking into it.</strong></p><p><strong>Sisters visit father\'s grave.&nbsp;</strong></p><p><strong>Fae becomes possessed by “Louise” Spirit - spirit attempts to kill Fae by drowning.</strong></p><p><strong>Sisters burn spirit and save Fae.&nbsp;</strong></p><p><strong>Family and neighbours send spirit back to spirit realm.</strong></p><p>________________________________________________________________</p><p><strong>EPISODE TWO “THE JOURNALS”</strong></p><p><strong>PAST - Elizabeth gives Manuelle to her servant Alkina..&nbsp;</strong></p><p><strong>Eleanor looks through mother belongings.&nbsp;</strong></p><p><strong>PAST - Manuelle grows up with Alkina’s family in the country.</strong></p><p><strong>Eleanor finds storage unit.</strong></p><p><strong>Sisters try and work out what’s wrong with Charlotte.&nbsp;</strong></p><p><strong>Manuelle Ghost attempts contact with Fae.</strong></p><p><strong>PAST - Manuelle finds a journal and begins to read and write.</strong></p><p><strong>Fae skips school to learn what visuals Manuelle is showing her.</strong></p><p><strong>PAST - Manuelle discovers her magic.&nbsp;</strong></p><p><strong>PAST - Alikna talks to her about her mother and magic. Gives Manuelle music box and envelope to open.</strong></p><p><strong>Sisters plan a health revealing spell. Margaux refuses magic They fight.</strong></p><p><strong>Margaux admits to magic block.</strong></p><p><strong>Colby dreams symbol.</strong></p><p><strong>Eleanor finds Chest and locked box.</strong></p><p><strong>PAST - Manuelle finds Alkina and family killed - She buries them and lives alone.</strong></p><p><strong>Eleanor finds journals.&nbsp;</strong></p><p><strong>Sisters attempt spell – Fae is possessed. Manuelle reveals warning and symbol.</strong></p><p><strong>Charlotte is tranced and lured to garden – wakes up in grassy symbol.</strong></p><p>______________________________________________________________________________</p><p><strong>EPISODE TWO “MEN IN THE NIGHT”</strong></p><p><strong>Journals date back 200 years. Can’t open locked box.&nbsp;</strong></p><p><strong>Sisters begin to think there’s nothing wrong with Charlotte.</strong></p><p><strong>PAST - Manuelle is 18, still living in Alkinas home. Man takes interest in her.</strong></p><p><strong>Fae attempts to learn visuals of land at the library.</strong></p><p><strong>Jarad and Amy arrive.</strong></p><p><strong>Colby visits town and Santasia’s workshop – feels being watched.</strong></p><p><strong>Colby sees painting with similar symbol in artwork.</strong></p><p><strong>PAST – Manuelle begins to trust man and like him.</strong></p><p><strong>Charlotte is called to school and informed of Fae missing school.&nbsp;</strong></p><p><strong>Charlotte does search spell and brings Fae home from Library as Fae learns of town witch suicide.&nbsp;</strong></p><p><strong>Fae and Charlotte Fight – Charlotte collapses and is taken to hospital by sisters.</strong></p><p><strong>Doctor tells the symptoms of cancer and thyroid disease.&nbsp;</strong></p><p><strong>Colby has a sense of being watched at hospital.</strong></p><p><strong>Violette sees man in another room at the hospital. Terminal.</strong></p><p><strong>Sisters go home – house feels like someone has been inside.</strong></p><p><strong>Man takes blood from Charlotte at hospital.</strong></p><p>______________________________________________________________________________</p><p><strong>EPISODE THREE “MEN IN THE NIGHT”</strong></p><p><strong>Aunt Eleanor arrives.&nbsp; Amy stayed the night.</strong></p><p><strong>Eleanor gives the daughters the journals and box – project for them.&nbsp;</strong></p><p><strong>Sisters work on Health Spell. Colby fascinated by box artwork.</strong></p><p><strong>Brooklyn’s birthday coming up. Eleanor wants to do inauguration.&nbsp;</strong></p><p><strong>Margaux reveals block. Eleanor’s furious.</strong></p><p></p><p>Fire Element comes to life. Margaux.</p><p>Transgender Witch, teaches Margaux to control.</p><p>Colby accidentally travels back in time.&nbsp;</p><p>Manuelle is released, ‘The Secret’ is mentioned.</p><p>Margaux and Aunt Eleanor travel to America for insight on Fire Element Witch.</p><p>Blood is Questioned, Bloodline is concerned.</p><p>Illuminati come after family, Family go into hiding.</p><p>Air Element comes to life. Brooklyn, - last episode</p><p>Travel to Alice Springs.</p><p></p>','2021-06-12 23:07:24','2021-06-21 01:17:55'),(6,3,0,'Main Events - Season One','<p><strong>Begining:</strong></p><p>- Charlottes sick</p><p>- Spirits released</p><p>- Sisters come home</p><p>- Sisters reignite Magic</p><p>- Prophecy revealed</p><p>- Manuelle spirit history revealed</p><p>- Margaux magic block/unblockElean</p><p>- Eleanor finds storage unit with box and journals</p><p>- Charlotte collapses</p><p>- Margaux magix turns to fire</p><p>- Men watching them</p><p>- Colby goes back in time and learns about their bloodline/journals indication</p><p>- Manuelle warns them of the enlightened and a secret we protected</p><p>- Family attacked and go into hiding</p><p>- jarad and knights templar revealed</p><p>- Eleanor is kidnapped</p><p>- Violette uncovers blood DNA differences</p><p>- National meeting is called</p><p>- Charlotte and eldest sisters go to find eleanor with knights templar</p><p>- Others go to national meeting - decision to remain in hiding.</p><p>- Brooklyns air magic ignited by aboriginals</p><p>- They find eleanor dead.</p><p>- Funeral for eleanor - Fae uncovers its not her. Shes still alive.</p><p></p>','2021-06-12 23:25:07','2021-06-21 01:11:10'),(7,3,0,'Witches Book 1 - Outline (Hero\'s Journey)','<p><strong>1. Ordinary World</strong></p><p>- Fae and Charlotte introduced in normal lives.</p><p>- Hint of Charlotte being sick. </p><p>- Fae releases Spirit, Fae and Charlotte attacked by louise and saved by Manuelle. </p><p>- Sisters introduced in their world. </p><p>- Recieve Fae\'s call for help. </p><p>- Sisters return home to house destroyed. </p><p>- Painful memories to be back.</p><p></p><p><strong>2. Call to Adventure</strong></p><p>- They make the decision to stay and help recover the home. </p><p>- </p><p></p><p>3. </p><p></p>','2021-06-12 23:48:14','2021-06-21 00:04:01'),(8,3,2,'After book 1 ideas','<p>Questions of why witches have their gift.</p><p>Who are they? What are they? Why are they different?</p><p>Ancient Civilisation oddities. Questions of Alien existence.&nbsp;</p><p>The planet\'s health is deteriorating. Natural disasters are occurring regularly.&nbsp;</p><p>People are feeling fear, anger, negative emotions. Not themselves.&nbsp;</p><p>The days are growing darker.</p><p>Family travels to Egypt to investigate these ancient civilizations.&nbsp;</p><p>Secret revealed.&nbsp;</p><p>They are descendants from an Ancient Alien Civilization who came to earth thousands and thousands of years ago.&nbsp;</p><p>“We are the secret, that is why we are different”</p><p>Discoveries of their ancestors.</p><p>Questions of why did they not return?</p><p>What happened to them? Why did they leave us? Where are they?</p><p>Can they help? How do we contact them?</p><p>Journals Reveal a map.&nbsp;</p><p>Keys, portals to send a message to Ancients.&nbsp;</p><p>Journey to find keys and portals.</p><p>Open portals. Fae doesn’t wake up. Body begins to die.</p><p>Sisters use their elemental powers to bring her back to life, almost burning themselves out. Fae awakes.&nbsp;</p><p>Something is heading towards earth.&nbsp;</p><p>Ancients arrive. Historical earth moment.&nbsp;</p><p>Earthiens and Ancients discuss the darkness effecting the universe.&nbsp;</p><p>Planets have been destroyed. Many lives lost.</p><p>The balance is unbalanced. Good and Evil. Ying and Yang. Light and dark.</p><p>Darkness here is what we would call hell.</p><p>Dantes inferno (The nine hells)</p><p>God is our light. Question of his existence.</p><p>Mary, Mary Magdalene. The fourth gospel.&nbsp;</p><p>Spirit witch to contact him.&nbsp;</p><p>Fae approaches tree. Blleds, falls, dies. Fae travels to the inferno. Awakes and says god is here. God will help.&nbsp;</p><p>The ultimate light and the ultimate dark. People go mad, darkness spreads.&nbsp;</p><p>War.</p><p>Charlotte dies.</p><p>Defeat darkness.&nbsp;</p><p>Family travel to atlantis.</p>','2021-06-21 01:17:15','2021-06-21 01:17:32'),(9,3,2,'Book 1 Outline','<p><strong>ONE</strong></p><p><strong><em>“GHOSTS OF PAST”</em></strong></p><p><em>Family are separated, living normal individual lives.&nbsp;</em></p><p><em>FAE calls sisters for help, over concern on CHARLOTTE’s health.</em></p><p><em>FAE unleashes 2 spirits from Music Box accidently.</em></p><p><em>Spirits attack FAE and CHARLOTTE - Almost destroy home.</em></p><p><em>Sisters come home - no one knows what happened.</em></p><p><em>Sisters decide to reuse magic - except MARGAUX.</em></p><p><em>MARGAUX is furious at sister\'s’ decision.</em></p><p><em>One Spirit Possess FAE - informs of two spirits to family. Good and Bad.</em></p><p><em>Concerns of Europe have escalated - News Report.</em></p><p><em>Coven is informed of Spirits.&nbsp;</em></p><p><em>Sisters visit father\'s grave.&nbsp;</em></p><p><em>FAE becomes possessed by other Spirit, who attempts to kill FAE in dam.</em></p><p><em>Sisters burn spirit and save FAE through using their magic.&nbsp;</em></p><p><em>Family and neighbours send spirit back to spirit realm.</em></p><p><strong><em>“THE JOURNALS”</em></strong></p><p><em>MARGAUX begins snapping at her sisters because they want her to use her magic and snapping at CHARLOTTE because she blames CHARLOTTE for her choices. No one understands what she means.</em></p><p><em>PAST - Elizabeth gives daughter MANUELLE to her servant ALKINA.</em></p><p><em>Sisters begin to feel a little lost at home, what\'s their path, what are they doing? They resort to focusing on why they think they are there...CHARLOTTE.&nbsp;</em></p><p><em>VIOLETTE is receiving messages from AMY concerned about her studies.&nbsp;</em></p><p><em>Sisters try and work out what’s wrong with CHARLOTTE.&nbsp;</em></p><p><em>MANUELLE Ghost attempts contact with FAE.</em></p><p><em>ELEANOR looks through mother’s belongings - finds note.</em></p><p><em>PAST - MANUELLE grows up with ALKINA’s family in the country.</em></p><p><em>FAE skips school to learn what visuals MANUELLE is showing her.</em></p><p><em>ELEANOR finds storage unit.</em></p><p><em>COLBY dreams symbol.</em></p><p><em>PAST - MANUELLE finds a journal and begins to read and write.</em></p><p><em>Sisters begin to snap at each other over little things, past creeping in.&nbsp;</em></p><p><em>They plan a health revealing spell.&nbsp;</em></p><p><em>MARGAUX refuses magic They fight.</em></p><p><em>PAST - MANUELLE discovers her magic.&nbsp;</em></p><p><em>PAST - ALKINA talks to her about her mother and magic.&nbsp;</em></p><p><em>PAST - Gives MANUELLE music box and envelope to open.</em></p><p><em>MARGAUX admits to magic block.</em></p><p><em>ELEANOR finds Chest and locked box.</em></p><p><em>PAST - MANUELLE finds ALKINA and family killed - She buries them and lives alone.</em></p><p><em>ELEANOR finds journals.&nbsp;</em></p><p><em>Sisters attempt spell – FAE is possessed.&nbsp;</em></p><p><em>MANUELLE reveals warning and symbol.</em></p><p><em>CHARLOTTE is getting weaker, tries to hide it.</em></p><p><em>CHARLOTTE is tranced and lured to garden – wakes up in grass symbol.&nbsp;</em></p><p><strong><em>“MEN IN THE NIGHT”</em></strong></p><p><em>Journals date back 200 years. ELEANOR can’t open small locked box.&nbsp;</em></p><p><em>Her sends CHARLOTTE back music box. BROOKLYN takes interest.</em></p><p><em>Sisters begin to think there’s nothing wrong with CHARLOTTE.</em></p><p><em>Sisters start to lose focus on why they are there, begin doing their own things, they’re not used to the family life.</em></p><p><em>PAST - MANUELLE is 18, still living in ALKINA’s family home.&nbsp;</em></p><p><em>PAST - Man takes interest in MANUELLE.</em></p><p><em>Sisters argue with MARGAUX over using Magic.&nbsp;</em></p><p><strong><em>MARGAUX fights with CHARLOTTE about their father.</em></strong></p><p><em>Surprise visit from JARAD, and AMY arrives with VIOLETTEs things.</em></p><p><em>MARGAUX and JARAD ride out to the nearest Pub.</em></p><p><em>AMY comes in, bringing all VIOlettes studdy books and personal things.&nbsp;&nbsp;</em></p><p><em>MANUELLE continues to send visuals and FAE continues to try and learn visuals of land at the library - sense being followed.</em></p><p><em>COLBY feel trapped at home and visits town and Santasia’s workshop – feels being watched.</em></p><p><em>CHARLOTTE arrives back to the house and meets AMY. AMY is helping VIOLETTE with her studies. CHARLOTTE asks wheres MARGAUX and COLBY and BROOKLYN tell her.</em></p><p><em>COLBY sees painting with similar symbol in artwork.</em></p><p><em>PAST – MANUELLE begins to trust man and like him.</em></p><p><em>FAE learns of town witch suicide.</em></p><p><em>CHARLOTTE is called to school (followed) and informed of FAE missing school.&nbsp;</em></p><p><em>CHARLOTTE does search spell and brings FAE home from Library.</em></p><p><em>PAST - MANUELLE is 18, still living in ALKINAs home. Man takes interest in her.</em></p><p><em>PAST – MANUELLE begins to trust man and like him – he proposes. She says no.</em></p><p><em>PAST – MANUELLE thinks she loses man – safe – realises she loves him.</em></p><p><em>FAE and CHARLOTTE Fight – CHARLOTTE collapses and is taken to hospital by sisters.</em></p><p><em>Doctor tells the symptoms of cancer and thyroid disease - but it’s something else.</em></p><p><strong><em>Doctor offers for her coven to attempt healing spell on CHARLOTTE after visiting hours.</em></strong></p><p><em>COLBY has a sense of being watched at hospital.</em></p><p><em>Sisters go home – house feels like someone has been inside.</em></p><p><em>Man takes blood from CHARLOTTE at hospital.</em></p><p><strong><em>“MEDICINE AND MAGIC”</em></strong></p><p><em>COLBY is struggling with boredom in the house, they’ve cleaned as much as they can. She feels trapped. She decides to visit Santasia’s Art Gallery in town.</em></p><p><em>Aunt ELEANOR arrives. AMY stayed the night.</em></p><p><em>The sisters with CHarlotte away, are barely communicating. When they do, its short, no one is the boss of anyone.</em></p><p><em>ELEANOR gives the daughters the journals and box – project for them.&nbsp;</em></p><p><em>FAE takes interest in a journal by a young girl “AB”</em></p><p><em>BROOKLYN takes interest in journal - focussed on energy vibrations but also dark ideas “MB”</em></p><p><em>ELEANOR takes book from BROOKLYN and keeps it.</em></p><p><em>COLBY fascinated by small box carvings.</em></p><p><strong><em>VIOLETTE visits hospital with BROOKLYN, doctor tells them they were unsuccessful with the spell. VIOLETTE is furious.</em></strong></p><p><strong><em>Doctors put CHARLOTTE on magical healing watch.</em></strong></p><p><em>FAE is grounded. FAE learns of witch hunting online. - Louise baker.</em></p><p><em>PAST - MANUELLE marries the man and they build home.&nbsp;</em></p><p><em>COLBY visits Santasia workshop - practices. COLBY visits Santasias art gallery and gets some lessons on her work. Some old art gallery gets brought in from the city _____.Plays with box and leaves it there.</em></p><p><em>BROOKLYN opens music box. Listens to tune. Finds latch.&nbsp;</em></p><p><em>BROOKLYN’s birthday coming up. ELEANOR wants to do inauguration.&nbsp;</em></p><p><em>MARGAUX reveals block. ELEANOR’s furious.</em></p><p><em>ELEANOR begins to read the journal by \"MB\" she notices the dark talks of her mother Mary Black. \"Hello Mother\"</em></p><p><em>VIOLETTE finds medicine remedies in journals with the help of MANUELLE Spirit.</em></p><p><em>PAST - MANUELLE begins work in magical remedies - town witch.</em></p><p><em>While reading next to CHARLOTTE at the hospital, VIOLETTE attempts medicine magic on terminally ill man at hospital.&nbsp;</em></p><p><em>FAE finds symbol in journal. FAE notices “B” initials - black ancestor journals.</em></p><p><em>VIOLETTE picks up CHARLOTTE - man is gone .&nbsp;</em></p><p><em>PAST - MANUELLE has ANNALISE. 1 year old.</em></p><p><em>CHARLOTTE medication is helping her improve a lot - she comes home.</em></p><p><em>BROOKLYNs Birthday.</em></p><p><em>CHARLOTTE finds out about MARGAUX Block - ELEANOR and CHARLOTTE unblock her.</em></p><p><em>MARGAUX and CHARLOTTE talk about father\'s death.</em></p><p><em>PAST - MANUELLE meets Louise.</em></p><p><em>PAST - MANUELLE finds the key inside the music box.</em></p><p><strong><em>ELEANOR reads MB journal. “Hello Mother”</em></strong></p><p><strong><em>“INAUGURATION”</em></strong></p><p><em>MARGAUX\'s body temperature is being effected by her new power, always hot. She doesn\'t respond. BROOKLYN is teaching her to control her magic. But MARGAUX is struggling, flustered and bothered.</em></p><p><em>CHARLOTTE is getting weaker.</em></p><p><em>MARGAUX practices magic - starts burning things accidentally - FAE notices.</em></p><p><em>MANUELLE Spirit tries to help MARGAUX “Accept it”</em></p><p><em>Sisters and ELEANOR plan inauguration.</em></p><p><em>COLBY unlocks box at workshop, with symbol, Monochrome inside. COLBY is at art gallery and pulls out frame looking for something else. and hears water rushing around some of the paintings. She walks to the painting with water flowing. Senses power from the frame and holds it up. To see the water in the frame moving just as Santasia walks in.</em></p><p><em>JARAD tries to help out at the house - Annoys MARGAUX.</em></p><p><em>VIOLETTE finds journal with connection with Magic and Medicine.</em></p><p><em>When they Look for wood (wand), they start to talk and apologize.</em></p><p><em>Inauguration day.</em></p><p><em>Day of Celebration Morning - FAE is in back forest, set up where they’ll sneak off to tonight. FAE places crystals from school bag.&nbsp;</em></p><p><em>Sisters practice for inauguration.</em></p><p><em>Cars start to arrive at twilight. The girls are getting ready. Marlina and Santasia are doing the girl’s hair and makeup. Aunt eleanor arrives, followed by her. HER says she will meet them down there.&nbsp;</em></p><p><em>MARGAUX is nervous because she doesn’t do well.</em></p><p><em>CHARLOTTE gives MARGAUX Dad’s Jacket, brings her peace.</em></p><p><em>Before the inauguration the sisters become more focused as a family and less on their own struggles, finding a new peace and love in their hearts.&nbsp;</em></p><p><em>The girls follow a beautiful lit path down to the back forest to an open area full of women all in cream white, flowers in hair, candles in their hands lit. They’re circled around her who stands in the centre waiting for them. They kneel at her feet and the ceremony begins. They wash their hands in a bowl of water that is blessed by the moon, holding hands each sister stands and accepts the coven.&nbsp;</em></p><p><em>Sisters are accepted.</em></p><p><em>Later there is a feast and dancing amongst the witches. The sisters sneak off to their hiding place.</em></p><p><em>FAE decides to contact MANUELLE on full moon after ceremony.</em></p><p><em>MANUELLE warning. “Blood, Warning, Yes, Run”</em></p><p><em>FAE tells family.</em></p><p><strong><em>“THE FIRE WITHIN”</em></strong></p><p><em>MARGAUX still struggling.</em></p><p><em>Sisters notice margaux burning things. Something’s wrong - contacts Her.&nbsp;</em></p><p><em>MARGAUX has mental breakdown - JARAD helps distract her.&nbsp;</em></p><p><em>PAST - ANNALISE and husband go on carriage trip out of town. They don’t come back.</em></p><p><em>FAE learns of witch hunters using witches to get witches.&nbsp;</em></p><p><em>PAST - Louise gives MANUELLE news of families death next morning. MANUELLE goes to bridge, sees destroyed carriage down cliff edge. She sets fire trees near her.&nbsp;</em></p><p><em>FAE learns that the journal ANNALISE, is MANUELLEs daughter and she doesn’t know she lived, “She didn’t know”.</em></p><p><em>PAST - MANUELLE races home on horse. She locks home, unaware Louise is inside. She grabs music box, and sacrifices herself to it in order to protect its secret.&nbsp;</em></p><p><strong><em>ANNALISE wakes up in hospital.</em></strong></p><p><strong><em>FAE is reading ANNALISE journal. Visits home, finds journal and music box.</em></strong></p><p><em>MANUELLE enters MARGAUXs dream, trying to help her understand her gift but unaware, MARGAUX has set her bedroom aflame.&nbsp;</em></p><p><em>CHARLOTTE saves her and girls.</em></p><p><em>CHARLOTTE is angry at Spirit. FAE admits she knows who she is.&nbsp;</em></p><p><em>CHARLOTTE crosses MANUELLE spirit over in anger.&nbsp;</em></p><p><em>CHARLOTTE loses it at MANUELLE - stay away from her daughters, tells her of her own daughter. She survived. Reads manuelle ANNALISE journal.</em></p><p><em>MANUELLE shares warning of secret. Interrupted by fire brigade.</em></p><p><em>CHARLOTTE notices men watchings. CHARLOTTE hides weakness, coughs blood.</em></p><p><em>MARGAUX leaves with JARAD, doesn’t tell anyone.</em></p><p><strong><em>“THE ATTACK”</em></strong></p><p>ADD HUSBAND AND ANALISE JOURNEY HOME</p><p><em>‘Her’ gives MARGAUX gloves - to stop burning things. She will be down soon .</em></p><p><em>COLBY goes back to workshop - goes through time.&nbsp;</em></p><p><em>COLBY meets great, great grandmother and grandmother Mary young.</em></p><p><em>Santasia finds COLBY standing - calls family. Family arrive.</em></p><p><em>COLBY sees symbol - great grandmother keeps dreaming it. - bloodline.</em></p><p><em>VIOLETTE and BROOKLYN try and figure out what to do.&nbsp;</em></p><p><em>BROOKLYN covers COLBY’s eyes. Trance breaks. `</em></p><p><em>COLBY tells about bloodline.</em></p><p><em>Sisters tell CHARLOTTE about symbol.&nbsp;</em></p><p><em>VIOLETTE takes blood off her sisters and travels to university at night.</em></p><p><em>FAE ge ts warning from MANUELLE “They’re coming, you must protect our secret. You must”</em></p><p><em>CHARLOTTE and COLBY see “witch” to discus dreams and symbols.</em></p><p><em>AMY gets secret passes and VIOLETTE test blood in lab.</em></p><p><em>They find oddities in blood.</em></p><p><em>Power turns off - emergency lighting on.</em></p><p><em>BROOKLYN and FAE are at home alone trying to connect everything.</em></p><p><em>MARGAUX arrives home with jarad - house power turns off.&nbsp;</em></p><p><em>Call CHARLOTTE - JARAD goes to fix the power.&nbsp;</em></p><p><em>JARADs father is there - warns they are coming.&nbsp;</em></p><p><em>Escape as men raid the house.</em></p><p><em>VIOLETTE and AMY are close to kidnaped but survive.&nbsp;</em></p><p><em>AMY shot with dart.</em></p><p><em>CHARLOTTE and COLBY are transferred safely by help of witch.</em></p><p><em>MANUELLE spirit distracts men - allowing family to escape.&nbsp;</em></p><p><em>VIOLETTE takes her to motel and assess her. MANUELLE says warning to FAE.</em></p><p><em>Flame portal is sent to everyone - covens are under attack - go into hiding.</em></p><p><em>PAST - Weeks later, MANUELLE’s husband and ANNALISE arrive home to the burnt down home. The only thing found was the music box and a badly burnt journal.&nbsp;</em></p><p><strong><em>“WITCHES IN HIDING”</em></strong></p><p><em>Sisters travel the night, following JARAD father to safe house.</em></p><p><em>CHARLOTTE and COLBY travel by car to safe house.&nbsp;</em></p><p><em>VIOLETTE and AMY wait for help at Motel.&nbsp;</em></p><p><em>MARGAUX angry at JARAD - secrets.</em></p><p><em>Get in car and travel down coast.&nbsp;</em></p><p><em>Arrive at Glass house - everyone is there but ELEANOR. Covens are under attack.&nbsp;</em></p><p><em>JARAD and father reveal themselves.</em></p><p><em>Everyone puts information together.&nbsp;</em></p><p><em>A national meeting is called. All witches must head to Alice Springs.</em></p><p><em>*CHARLOTTE and sister refuse without ELEANOR - somethings wrong.&nbsp;</em></p><p><em>Marcus arrives - introduces himself as ELEANOR’s protector. Also with JARAD and Father.&nbsp;</em></p><p><em>The sisters begin to grow a maturity and learn that each have their own strengths and appreciate that of eachother. While they work together as a family, each holds a certain aspect to acheive what they seek.&nbsp;</em></p><p><em>CHARLOTTE, MARGAUX, VIOLETTE stay - COLBY, BROOKLYN and FAE go with coven.&nbsp;</em></p><p><em>Search Spell. Nothing.&nbsp;</em></p><p><em>CHARLOTTE is getting even weaker - coughing up blood. Looking very pale. The sisters notice.</em></p><p><em>Coven travel by train to Alice Springs - flight to dangerous.&nbsp;</em></p><p><em>Ch, M, V go to ELEANOR’s house - struggle obvious - find phone and video. location&nbsp;</em></p><p><em>LUCIO and JACK are at abandoned house.&nbsp;</em></p><p><em>ELEANOR is inside abandoned house - hurt badly.&nbsp;</em></p><p><em>ELEANOR’s interrogated.</em></p><p><em>JACK and team find location - family attack, Place is abandoned ELEANOR inside dead.&nbsp;</em></p><p><em>Family take her coffin to alice springs.</em></p><p><em>Funeral heald. FAE knows it’s not ELEANOR.&nbsp;</em></p><p><em>Body transforms at FAE’s touch.&nbsp;</em></p><p><em>ELEANOR’s still alive.&nbsp;</em></p><p><strong><em>“NATIONAL MEETING”</em></strong></p><p><em>Witches come from around the land to the outback rocks.&nbsp;</em></p><p><em>National Meeting Held. Questions - who are these men? What to do? Fight?</em></p><p><em>World is a dangerous place. Decision is not made, all to remain in hiding as only few members of coens were attacked - ‘her’ is furious.&nbsp;</em></p><p><em>CHARLOTTE sees a healer and is healed.</em></p><p><em>Everyone returns home but those who were attacked.&nbsp;</em></p><p><em>Black family stay with PARMIL - very rich home in city.&nbsp;</em></p><p><em>FAE learns of Witches manipulating fire in history.</em></p><p><em>PARMIL helps MARGAUX with her magic.&nbsp;</em></p><p><em>COLBY tries to understand the monochrome. Figures out the timer.&nbsp;</em></p><p><em>Tests it with painting - doesn’t work- then with symbol.Does.</em></p><p><em>ELEANOR being tortured - flashback mother and how to send messages.&nbsp;</em></p><p><em>ELEANOR sends message to CHARLOTTE. France, 1867 EB.&nbsp;</em></p><p><em>They agree to go back in time to france 1867 EB. against the National Coven decision.&nbsp;</em></p><p><em>Sisters are dressed, MARGAUX, COLBY, BROOKLYN, VIOLETTE and JARAD sent back.&nbsp;</em></p><p><em>Go back in time.&nbsp;</em></p><p><em>VIOLETTE is shot - COLBY and MARGAUX is holding her, on the run. JARAD is firing back at people. BROOKLYN is missing.&nbsp;</em></p><p><em>End.&nbsp;</em></p><p><strong>TWO</strong></p><p>Air Element comes to life. BROOKLYN, - last episode</p><p><strong>THREE</strong></p><p><strong>TO ORDER</strong></p><p>Questions of why witches have their gift.</p><p>Who are they? What are they? Why are they different?</p><p>Ancient Civilisation oddities. Questions of Alien existence.&nbsp;</p><p>The planet\'s health is deteriorating. Natural disasters are occurring regularly.&nbsp;</p><p>People are feeling fear, anger, negative emotions. Not themselves.&nbsp;</p><p>The days are growing darker.</p><p>Family travels to Egypt to investigate these ancient civilizations.&nbsp;</p><p>Secret revealed.&nbsp;</p><p>They are descendants from an Ancient Alien Civilization who came to earth thousands and thousands of years ago.&nbsp;</p><p>“We are the secret, that is why we are different”</p><p>Discoveries of their ancestors.</p><p>Questions of why did they not return?</p><p>What happened to them? Why did they leave us? Where are they?</p><p>Can they help? How do we contact them?</p><p>Journals Reveal a map.&nbsp;</p><p>Keys, portals to send a message to Ancients.&nbsp;</p><p>Journey to find keys and portals.</p><p>Open portals. FAE doesn’t wake up. Body begins to die.</p><p>Sisters use their elemental powers to bring her back to life, almost burning themselves out. FAE awakes.&nbsp;</p><p>Something is heading towards earth.&nbsp;</p><p>Ancients arrive. Historical earth moment.&nbsp;</p><p>Earthiens and Ancients discuss the darkness effecting the universe.&nbsp;</p><p>Planets have been destroyed. Many lives lost.</p><p>The balance is unbalanced. Good and Evil. Ying and Yang. Light and dark.</p><p>Darkness here is what we would call hell.</p><p>Dante’s inferno (The nine hells)</p><p>God is our light. Question of his existence.</p><p>Mary, Mary Magdalene. The fourth gospel.&nbsp;</p><p>Spirit witch to contact him.&nbsp;</p><p>FAE approaches tree. Bleeds, falls, dies. FAE travels to the inferno. Awakes and says god is here. God will help.&nbsp;</p><p>The ultimate light and the ultimate dark. People go mad, darkness spreads.&nbsp;</p><p>War.</p><p>CHARLOTTE dies.</p><p>Defeat darkness.&nbsp;</p><p>Family travel to atlantis.</p>','2021-06-21 01:18:31','2021-06-21 01:18:53'),(10,3,0,'Structure','<p>Q: Do we introduce sister in their lives and then Fae and her situation?</p><p>Q: Do we expand on the sisters introduction a little more so we get a sense of who they are the the world they are leaving behind to come home?</p><p>Q:  When sisters are there in first meeting - whose view point should it be?</p><p>Q: Pilot Manuelle starts talking to Fae here - should we have it further down the track? </p><p>Q: What is Louise doing right now? Or Manuelle? We have more time now. Do we start it later?</p><p>Q: if we do we need to bring upon the attack a different way.</p><p>- I think that Manuelle is really weak from the power she used and she has retreated to the music box. </p><p>- Louise is around the home, locked out. For her to get to Fae she needs to call her outside. </p><p></p>','2021-06-21 22:12:16','2021-06-21 22:31:30'),(11,11,0,'Outline of First Book','<p>Begining </p><p>- She walks outside and notices the postman</p><p>- Calls out to mum.</p>','2021-07-13 09:27:30','2021-07-13 09:27:50'),(12,11,1,'18th century england','<p>Research the clothing in 18th century england. </p><p></p><p>At the beginning of the&nbsp;<strong>18th century</strong>&nbsp;the male silhouette differed greatly from that of today. A typical outfit consisted of a full-skirted knee-length coat, knee breeches, a vest or long waistcoat (which could be sleeved), a linen shirt with frills and linen underdrawers.&nbsp;</p><p></p><p></p><p></p><p></p>','2021-07-13 09:28:04','2021-07-13 09:28:44'),(13,3,0,'sdfsd',NULL,'2021-07-26 22:54:12','2021-07-26 22:54:12'),(14,12,0,'test','<p>test cdsdasdasdsdasdasd</p>','2021-08-02 06:11:41','2021-08-02 06:12:20'),(15,12,2,'test','<p>test</p>','2021-08-02 06:11:59','2021-08-02 06:12:08');
